import React from "react";
import "../styles/bottombar.css";



function BottomBar() {
    return ( 
        <div className = "bottomBar">
            <p>Kingdom Hearts III</p>
            <p>The Walking Dead</p>
            <p>God of War</p>
            <p>Marvel's The Avenger's: Infinity War</p>

        </div>
    );
}

export default BottomBar;
